public class InnerLaunchTemplateLaunchTemplateDataFactory(Action<Humidifier.EC2.LaunchTemplateTypes.LaunchTemplateData> factoryAction = null) : SubResourceFactory<Humidifier.EC2.LaunchTemplateTypes.LaunchTemplateData>
{

    internal InnerLaunchTemplateMaintenanceOptionsFactory MaintenanceOptionsFactory { get; set; }

    internal InnerLaunchTemplateIamInstanceProfileFactory IamInstanceProfileFactory { get; set; }

    internal InnerLaunchTemplatePlacementFactory PlacementFactory { get; set; }

    internal InnerLaunchTemplateEnclaveOptionsFactory EnclaveOptionsFactory { get; set; }

    internal InnerLaunchTemplateMonitoringFactory MonitoringFactory { get; set; }

    internal InnerLaunchTemplateHibernationOptionsFactory HibernationOptionsFactory { get; set; }

    internal InnerLaunchTemplateMetadataOptionsFactory MetadataOptionsFactory { get; set; }

    internal InnerLaunchTemplateCpuOptionsFactory CpuOptionsFactory { get; set; }

    internal InnerLaunchTemplatePrivateDnsNameOptionsFactory PrivateDnsNameOptionsFactory { get; set; }

    internal InnerLaunchTemplateInstanceMarketOptionsFactory InstanceMarketOptionsFactory { get; set; }

    internal InnerLaunchTemplateInstanceRequirementsFactory InstanceRequirementsFactory { get; set; }

    internal InnerLaunchTemplateCapacityReservationSpecificationFactory CapacityReservationSpecificationFactory { get; set; }

    internal InnerLaunchTemplateCreditSpecificationFactory CreditSpecificationFactory { get; set; }

    protected override Humidifier.EC2.LaunchTemplateTypes.LaunchTemplateData Create()
    {
        var launchTemplateDataResult = CreateLaunchTemplateData();
        factoryAction?.Invoke(launchTemplateDataResult);

        return launchTemplateDataResult;
    }

    private Humidifier.EC2.LaunchTemplateTypes.LaunchTemplateData CreateLaunchTemplateData()
    {
        var launchTemplateDataResult = new Humidifier.EC2.LaunchTemplateTypes.LaunchTemplateData();

        return launchTemplateDataResult;
    }
    public override void CreateChildren(Humidifier.EC2.LaunchTemplateTypes.LaunchTemplateData result)
    {
        base.CreateChildren(result);

        result.MaintenanceOptions ??= MaintenanceOptionsFactory?.Build();
        result.IamInstanceProfile ??= IamInstanceProfileFactory?.Build();
        result.Placement ??= PlacementFactory?.Build();
        result.EnclaveOptions ??= EnclaveOptionsFactory?.Build();
        result.Monitoring ??= MonitoringFactory?.Build();
        result.HibernationOptions ??= HibernationOptionsFactory?.Build();
        result.MetadataOptions ??= MetadataOptionsFactory?.Build();
        result.CpuOptions ??= CpuOptionsFactory?.Build();
        result.PrivateDnsNameOptions ??= PrivateDnsNameOptionsFactory?.Build();
        result.InstanceMarketOptions ??= InstanceMarketOptionsFactory?.Build();
        result.InstanceRequirements ??= InstanceRequirementsFactory?.Build();
        result.CapacityReservationSpecification ??= CapacityReservationSpecificationFactory?.Build();
        result.CreditSpecification ??= CreditSpecificationFactory?.Build();
    }

} // End Of Class

